import {getMenuItems} from "./apiHelper";

async function getServerSideProps() {
    console.log('@@@@@call get initial props');
    const menuItems = await getMenuItems();
    console.log('@@@@@get menu items');
    return {
        props: {
            menuItems
        }
    }
}

export {
    getServerSideProps
}
